import React from 'react'
import Card from './Card'
import styled from 'styled-components'

const StyledCeramics = styled.div`
  display: flex;
  height: 100vh;
`

const cards = [{title: 'one'},{title: 'two'},{title: 'thfree'}]

const Ceramics = (props) => {
  return (
    <StyledCeramics>
      { cards.map(elem => {
        return (
          <Card title={elem.title} />
        )
      }
    )}
    </StyledCeramics>
  )
}

export default Ceramics
